def binary_search(array, target):
    lower = 0
    upper = len(array)
    while lower < upper:  
        x = lower + (upper - lower) // 2
        val = array[x]
        if target == val:
            return x
        elif target > val:
            if lower == x:   
                break        
            lower = x
        elif target < val:
            upper = x



def linear_search(array, target):
    results=[]
    for i in range(len(array)):
        pattern="\s"
        matchObj = re.match( target+pattern, array[i], re.M|re.I)
        if matchObj:
           results.append(i)
        pattern="[a-z]{1,3}$"
        matchObj = re.match( target+pattern, array[i], re.M|re.I)
        if matchObj:
            results.append(i)
    return results











