@app.route(entry_point+'/results/<chosen_tool>', methods=["GET", "POST"])
def results(chosen_tool):
	query1 = "SELECT * FROM articles LEFT JOIN tools ON tools.article_fk=articles.id LEFT JOIN metrics ON metrics.id= articles.id WHERE (LCASE(abstract_normalized) LIKE %(this_name)s OR LCASE(topics) LIKE %(this_name)s OR LCASE(name_tool) LIKE %(this_name)s) AND LCASE(name_tool) IS NOT NULL ORDER BY citations_per_year DESC"
	tool_info = pd.read_sql(query1,con=engine, params={'this_name': '%' + chosen_tool +'%'})

# too many results use championship list, split words by spaces and put into an array, then binary search on search_words, get indexes, leave 400 most popular as results	
	results=[]
	if len(tool_info) > 400:
		words_array=chosen_tool.split()
		for word in words_array:
			results.append(linear_search(SEARCH_WORDS, word))
# At this point we have list of relavant indices, now we want to get ids of tool for this indices
#results is list of list we need to fix it
		results = [item for sublist in results for item in sublist]
		results_tools=[]
		for index in results:
		    results_tools.append(index_of_tool_word[index])
# Now we have list of list of relevant tools ids, change it into a list, make sure ids are unique (set)
		results_tools_id = [item for sublist in results_tools for item in sublist]
		results_tools_id_set=set(results_tools_id)
# make the set into string that query can take
		result_test=str(results_tools_id_set)
		result_test=result_test[5:-2]

		query1 = "SELECT * FROM tools LEFT JOIN articles ON articles.id=tools.article_fk LEFT JOIN metrics ON metrics.id= tools.article_fk WHERE tools.id IN (" + result_test+ ") ORDER BY citations_per_year DESC"
		tool_info = pd.read_sql(query1,con=engine)
	length=len(tool_info)
	if length == 0:
		return redirect(url_for('search'))
	else:	
		return render_template("results.html", tool_info=tool_info, length=length, entry_point=entry_point, chosen_tool=chosen_tool)


